svg.script:
/*  */
// @license magnet:?xt=urn:btih:90dc5c0be029de84e523b9b3922520e79e0e6f08&dn=cc0.txt
let wpc = 0, tId = null, wp, mpX, mpY;
function insideJigsaw(m,tp) {
  let mX = m.clientX, mY = m.clientY;
  if (mX != mpX && mY != mpY) return (mX >= 230 && mX <= 770)&&(mY >= 105 && mY <= (tp?1000:900));
  return false;
}
function offsets(tl) {
  for (let i = 0; i < tl.numberOfItems; i++) {
    const transform = tl.getItem(i);
    if (transform.type === SVGTransform.SVG_TRANSFORM_TRANSLATE) return [transform.matrix.e,transform.matrix.f];
  }
}
function parseTransform(el) {
  const t = {
    tx: 0,
    ty: 0,
    angle: 0
  };
  const tf = (el.getAttribute('transform') || '').trim();
  const trMatch = tf.match(/translate\(\s*([-\d.+e]+)(?:[ ,]\s*([-\d.+e]+))?\s*\)/i);
  if(trMatch) {
    t.tx = parseFloat(trMatch[1]) || 0;
    t.ty = parseFloat(trMatch[2]) || 0;
  }
  const rotMatch = tf.match(/rotate\(([^,)]+)(?:,\s*[^,)]+,\s*[^,)]+)?\)/);
  if(rotMatch) {
    t.angle = parseFloat(rotMatch[1]) || 0;
  }
  return t;
}
function writeTransform(el, tx, ty) {
  el.setAttribute('transform', `translate(${tx} ${ty})`);
}
function shuffleArray(ary) {
  let currentIndex = ary.length, randomIndex;
  while (currentIndex !== 0) {
    randomIndex = Math.floor(Math.random() * currentIndex);
    currentIndex--;
    [ary[currentIndex], ary[randomIndex]] = [ary[randomIndex], ary[currentIndex]];
  }
  return ary;
}
function shuffleCoordinates() {
  const elements = document.querySelectorAll('use[href="#ur"]');
  const coordinates = [];
  elements.forEach(element => {
    const x = element.getAttribute('x');
    const y = element.getAttribute('y');
    if (x !== null && y !== null) {
      coordinates.push({ x: x, y: y });
    }
  });
  shuffleArray(coordinates);
  elements.forEach((element, index) => {
    if (index < coordinates.length) {
      const newCoords = coordinates[index];
      element.setAttribute('x', newCoords.x);
      element.setAttribute('y', newCoords.y);
    }
  });
}
function hint(tX,tY) {
  if (tX && tY) {if (tX > 150 || tY > 100) return;}
  const cp = document.querySelector("[clip-path]");
  if (!cp) return;
  cp.removeAttribute("clip-path");
  tId = setTimeout(() => {
    cp.setAttribute("clip-path", "url(#edges)");
  }, 2000);
}
document.onreadystatechange = () => {
  if(document.readyState === "interactive") {
    shuffleCoordinates();
    const svgCanvas = document.querySelector("svg"),ck = document.getElementById("timer");
    let isDragging = false,wb = 1;
    let xcoord,ycoord,cel;
    for (const u of document.querySelectorAll('g[transform^="translate"]')) {
      u.addEventListener("wheel", (e) => {
        e.preventDefault();
        let v = u.firstElementChild,
        w = parseTransform(v),
        ux = parseFloat(v.getAttribute("x")) + 50,
        uy = parseFloat(v.getAttribute("y")) + 50,
        ra = w.angle;
        wb = -(wb);
        if (wb > 0) v.setAttribute("transform","rotate(" + ((e.deltaY > 0)?(ra + (ra==345?-(ra):15)):(ra==-345?(ra + 345):(ra - 15))) + "," + ux +"," + uy +")");
      });
      u.addEventListener("mousedown", (e) => {
        if(e.button != 0) return;
        isDragging = true;
        cel = u;
        let [tX,tY] = offsets(cel.transform.baseVal);
        mpX = e.clientX;
        mpY = e.clientY;
        xcoord = mpX - 25 - tX;
        ycoord = mpY - 25 - tY;
      });
    }
    svgCanvas.addEventListener("mousemove", (e) => { 
      if (isDragging) {
        cel.setAttribute("transform","translate(" + (e.clientX - 25 - xcoord) + " " + (e.clientY - 25 - ycoord) + ")");
      }
    });
    svgCanvas.addEventListener("mouseup", (e) => {
      let et = e.target.parentNode;
      if ((insideJigsaw(e))&&(et instanceof SVGGElement)&&(wp!=et)&&(wpc < 9999999)) {
        wp = et;
        wpc++;
        document.getElementById("moves").textContent = wpc.toString().padStart(7, "0");
      } else if (isDragging && !insideJigsaw(e)) cel.setAttribute("transform","translate(0 0)");
      isDragging = false;
    });
    ck.addEventListener("mouseover", (e) => {
      const cp = document.querySelector("[clip-path]");
      if (cp && !tId && e.clientY < 90) hint();
    });
    ck.addEventListener("mouseout", (e) => {
      if (e.clientY > 100 || e.clientX > 150) tId = null;
    });
    svgCanvas.addEventListener('touchstart', onTouchStart, {
      passive: false
    });
    svgCanvas.addEventListener('touchmove', onTouchMove, {
      passive: false
    });
    svgCanvas.addEventListener('touchend', onTouchEnd, {
      passive: false
    });
    svgCanvas.addEventListener('touchcancel', onTouchCancel, {
      passive: false
    });
  }
}
// Touch support for dragging and second-finger tap rotation. 
const MOVE_THRESHOLD = 2; // pixels 
let primaryTouch = null; // {	id,	startX, startY,	elem, origTx,	origTy, origAngle, moved, currentAngle }
let rotationTouch = null; // { id }
const pieceSelector = 'g[transform^="translate"]';
let piecesCache = null;

function refreshPiecesCache() {
  piecesCache = new Set(document.querySelectorAll(pieceSelector));
}

function getTouchById(touches, id) {
  for(let i = 0; i < touches.length; i++) {
    if(touches[i].identifier === id) return touches[i];
  }
  return null;
}

function findPieceElement(node) {
  if(!piecesCache) refreshPiecesCache();
  while(node && node !== document) {
    if(piecesCache.has(node)) return node;
    node = node.parentNode;
  }
  return null;
}

function onTouchStart(e) {
  if(!e.changedTouches || e.changedTouches.length === 0) return; // For each new touch, check target piece 
  for(let i = 0; i < e.changedTouches.length; i++) {
    const t = e.changedTouches[i];
    hint(t.clientY, t.clientX);
    const target = document.elementFromPoint(t.clientX, t.clientY);
    if(!target) continue;
    if(!primaryTouch) {
      const piece = findPieceElement(target);
      if(!piece) continue; // If no primary touch, set this as primary (drag) 
      cel = piece;
      const tf = parseTransform(piece),
      tfc = parseTransform(piece.firstElementChild);
      for (const rv of document.querySelectorAll('path[style$="arrow)"]')) {
        rv.setAttribute("stroke","rgba(0,0,255,1)")
      }
      primaryTouch = {
        id: t.identifier,
        startX: t.clientX,
        startY: t.clientY,
        elem: piece,
        origTx: tf.tx,
        origTy: tf.ty,
        origAngle: tfc.angle,
        moved: false
      }; // Refresh pieces cache in case DOM changed 
      refreshPiecesCache();
      e.preventDefault();
    } else if(!rotationTouch) { // If a second finger touches rotation buttons, do the rotation 
      let v = primaryTouch.elem.firstElementChild;
      const tf = parseTransform(v),
      pressed = document.elementFromPoint(t.clientX, t.clientY);
      if(!pressed) continue;
      let ux = parseFloat(v.getAttribute("x")) + 50,
      uy = parseFloat(v.getAttribute("y")) + 50,
      ra = tf.angle;
      if(pressed.getAttribute("id") == "cw") {
        v.setAttribute("transform","rotate(" + (ra>330?0:(ra + 15)) + "," + ux +"," + uy +")")
      } else if (pressed.getAttribute("id") == "acw"){
        v.setAttribute("transform","rotate(" + (ra<0?330:(ra - 15)) + "," + ux +"," + uy +")")
      } 
      rotationTouch = {
        id: t.identifier,
      };
      e.preventDefault();
    }
  }
}

function onTouchMove(e) {
  if(!primaryTouch && !rotationTouch) return;
  e.preventDefault();
  if(primaryTouch) {
    const t = getTouchById(e.touches, primaryTouch.id);
    if(t) {
      const dx = t.clientX - primaryTouch.startX;
      const dy = t.clientY - primaryTouch.startY;
      if(!primaryTouch.moved && Math.hypot(dx, dy) < MOVE_THRESHOLD) { // ignore tiny jitter 
      } else {
        primaryTouch.moved = true;
        const newTx = primaryTouch.origTx + dx;
        const newTy = primaryTouch.origTy + dy;
        writeTransform(primaryTouch.elem, newTx, newTy);
      }
    }
  }
}

function onTouchEnd(e) {
  for(let i = 0; i < e.changedTouches.length; i++) {
    const t = e.changedTouches[i];
    if(primaryTouch && t.identifier === primaryTouch.id) {
      let et = primaryTouch.elem;
      if ((insideJigsaw(t))&&(et instanceof SVGGElement)&&(wp!=et)&&(wpc < 9999999)) {
        wp = et;
        wpc++;
        document.getElementById("moves").textContent = wpc.toString().padStart(7, "0");
      } else if (primaryTouch && !insideJigsaw(t,true)) cel.setAttribute("transform","translate(0 0)");
      primaryTouch = null;
      rotationTouch = null;
      for (const rv of document.querySelectorAll('path[style$="arrow)"]')) {
        rv.setAttribute("stroke","rgba(0,0,255,0)")
      }
    }
    if(rotationTouch && t.identifier === rotationTouch.id) {
      rotationTouch = null;
      if(primaryTouch && primaryTouch.currentAngle !== undefined) {
        primaryTouch.origAngle = primaryTouch.currentAngle;
        primaryTouch.currentAngle = undefined;
      }
    }
  }
}

function onTouchCancel(e) {
  onTouchEnd(e);
}

